function addRow(n){var r=$(n).parent().parent(),u=r.clone(),i,t;for(u.find("td > input").val(""),r.after(u),i=$("tbody tr > th"),t=0;t<i.length;t++)$(i[t]).text(t+1)}function covertAndDownload(n){if(n==null)alert("Musíš nahrať obrázok.");else{var t=$("tbody").find("input").map(function(){return parseInt($(this).val())}).toArray();$.post("/api/ConvertImgToWebP",{fileName:n,widths:t}).done(function(n){window.open(window.location.origin+n)}).fail(function(){alert("Niečo sa pokazilo. Skúste to ešte raz, alebo kontaktujte admina stránky. ")})}}